import React from 'react'
import useAuth from '../hooks/useAuth'

const Account = () => {
    const {auth} = useAuth();
    return (
        <div>
            <p>User: {auth.user}</p>
            <p>Number of coins: {auth.coins}</p>
        </div>
    )
}

export default Account
